import React from 'react';
import TabItem from './TabItem';
import bitcoinImage from '../images/bitcoin.jpg'
import adaImage from '../images/ada.jpg'
import ethereumImage from '../images/ethereum.jpg'

const Tab = ({setChosenCrypto}) => {

  const menuItems = [
    {name:"Bitcoin", image: bitcoinImage},
    {name:"Ethereum", image: adaImage},
    {name:"Cardano", image: ethereumImage},
   ];

 return (
 <div style={{
   display:"flex",
   justifyContent: "space-evenly",
   width:"100vw",
   height:"70px",
   background:"black",
   position:"absolute",
   bottom:"0",
   color:"white",
   alignItems:"center"

 }}
 >
   {menuItems.map((item) => {
     return (
     <TabItem 
      key={item.name}
      setChosenCrypto={setChosenCrypto}
      menuItem={item.name}
      />
     );
   })} 
 </div>  
 );  
};

export default Tab;
